import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { View } from "react-native";
import React from "react";
import Explore from "../screens/Explore";
import Favorites from "../screens/Favorites";
import Reservations from "../screens/Reservations";
import SettingsScreen from "../screens/Settings";
import { MaterialIcons } from '@expo/vector-icons';


const Tab = createBottomTabNavigator();

const NavBar = () => {
  return (
    <Tab.Navigator
      screenOptions={(router) => ({
          tabBarActiveTintColor: "#BFA27E",
          tabBarInactiveTintColor: "gray",
          tabBarIcon: () => screenOptions()

        })}
    
      // screenOptions={{
      //   tabBarShowLabel: true,
      //   tabBarActiveTintColor: "#BFA27E",
      //   tabBarInactiveTintColor: "gray",
      //   tabBarLabelPosition: "below-icon",
      //   tabBarIconStyle: {},
      //   tabBarLabelStyle: {},
      //   tabBarStyle: {
      //     backgroundColor: "white",
      //     position: "absolute",
      //     marginHorizontal: 10,
      //     height: 80,
      //     borderRadius: 20,
      //     shadowColor: "#000",
      //     shadowOpacity: 0.08,
      //     paddingHorizontal: 10,
      //   },
      // }}
    >
      <Tab.Screen
        name="Explore"
        component={Explore}
      />

      <Tab.Screen
        name="Favorites"
        component={Favorites}

      />

      <Tab.Screen
        name="Reservations"
        component={Reservations}
      />

      <Tab.Screen
        name="Settings"
        component={SettingsScreen}
      />

    </Tab.Navigator>
  );
};

function tabBarIconOptions (router, color, size) {
  let iconName;
  
  if (router.name === "Explore") {
    iconName = "";
  }
  if (router.name === "Favorites") {
    iconName = "";
  }
  if (router.name === "Reservations") {
    iconName = "";
  }
  if (router.name === "Settings") {
    iconName = "";
  }

  return (
    <MaterialIcons name={iconName} size={size} color={color} />
  )
}

export default NavBar;
